import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
//import './index.css';
//import reportWebVitals from './reportWebVitals';
import './App.css';
import Navbarmain from './Navbarmain';

class Ask extends Component{

    render() {
   
        return (
            <div>
            <Navbarmain />
<Form>
      <Form.Group>
        <Form.Label>Name</Form.Label>
        <Form.Control type="text" placeholder="Enter name" />
        
      </Form.Group>
      <Form.Group>
        <Form.Label>Email address</Form.Label>
        <Form.Control type="email" placeholder="Enter email" />
        
      </Form.Group>
      <Form.Control as="select">
    <option>Category/Topic</option>
    <option>Programming</option>
    <option>OS</option>
    <option>Maths/Physics</option>
    <option>Life</option>
    <option>Other</option>
  </Form.Control>
      <Form.Group >
        <Form.Label id="bbox">Question</Form.Label>
        <Form.Control type="text" placeholder="Enter your question here" />
      </Form.Group>
      <Form.Group>
        <Form.Check type="checkbox" label="I agree to Terms & Conditions" />
      </Form.Group>
      <Button variant="primary" type="submit">
        Ask!
      </Button>
    </Form>
    </div>

        );
    }
}
export default Ask;
